import React, {useState} from 'react';
import {registerAdminUrl} from '../../api/Api';
import axios from 'axios';
import {Box,Typography,Button, TextField}from '@mui/material'
import {AdminStyles} from '../auth/styles/AdminSignUp'

const AdminSignUp = () => {
  const initialValue = {
    firstName: '',
    lastName: '',
    email: '',
    phoneNumber: '',
    password: '',
    userName: '',
  };

  const [data, setData] = useState (initialValue);

  const handleChange = async e => {
    e.preventDefault ();
    setData (prevState => ({
        ...prevState,
      [e.target.name]: e.target.value
    }));
  };

  const handleSubmit = async e => {
        e.preventDefault ();
        const userData = {
            userName: data.userName,
            firstName: data.firstName,
            lastName: data.lastName,
            email: data.email,
            phoneNumber: data.phoneNumber,
            password: data.password
        }

        const response = await axios.post(registerAdminUrl, userData)

        if(response.status === 200){
            console.log('BC res --> ',response.data)
        }
    }

  return (
    <Box sx = {AdminStyles.AdminMainStyles}>
      <form  onSubmit={handleSubmit}>
        <div>
        <TextField
          label = "FirstName" 
          value={data.firstName} 
          name="firstName" 
          onChange={handleChange} 
          type="text"
        />
        </div>
        <div>
        <TextField
        label = "lastName"  
        value={data.lastName} 
        name="lastName" 
        onChange={handleChange} 
        type="text" 
        />
        </div>
        <div>
        <TextField
            label = "email" 
            value={data.email} 
            name="email" 
            onChange={handleChange} 
            type="email" 
        />
        </div>
        <div>
        <TextField
            label = "userName" 
            value={data.userName} 
            name="userName" 
            onChange={handleChange} 
            type="text" 
        />
        </div>
        <div>
        <TextField
             label = "phoneNumber" 
             value={data.phoneNumber}
             name="phoneNumber" 
             onChange={handleChange} 
             type="tel"
        />
        </div>
        <div>
        <TextField
          label = "password" 
          value={data.password} 
          name="password" 
          onChange={handleChange} 
          type="password" 
        />
        </div>
        <div>
          <Button 
           varient = 'container'
           type="submit">Submit
          </Button>
          </div>
      </form>
    </Box>
  );
};

export default AdminSignUp;
